import { Card, CardFooter, Image } from "@nextui-org/react";

export function SkillCard({ path, number, title }) {
  return (
    <div className="flex justify-center">
  <Card className="w-1/2 sm:w-2/5 md:w-3/10 lg:w-1/4 mx-auto md:mx-0 flex flex-col">
    <div className="flex-shrink-0 aspect-w-4 aspect-h-5">
      <Image
        removeWrapper
        alt="Card background"
        className="z-0 w-full h-full object-cover brightness-50"
        src={path}
      />
    </div>
    <CardFooter className="relative z-10 flex-grow-1 flex-col !items-start">
      <p className="text-tiny text-white/60 uppercase font-bold">{number}</p>
      <h4 className="text-white font-medium text-large">{title}</h4>
    </CardFooter>
  </Card>
</div>
  );
}
